import React from "react";
import styled from "styled-components"
import logoUa from "../../images/logoua.png"
import logoEciu from "../../images/logoeciu.png"

const LogUa = styled.img`
height: 25px;
  `
const LogEciu = styled.img`
height: 46px;
  `

export default () => {

    return (
        <Container>

            <div className="row">

            <LogEciu src={logoEciu} className="align-content-center"/>

            <LogUa src={logoUa} className="align-content-end"/>

            </div>
        </Container>
    )

}
